description:
A fork of [@leorawe: Books with Pages](https://vizhub.com/leorawe/6b49e9b37e9d4449958669ee53341acc) that shows how to get rid of the scroll bars.

The following CSS was added to the `body` section:

```
  margin: 0px;
  overflow: hidden;
```

